        {
            var totalcount = Object.entries(props.langslist).map(([key, eachitem]) =>
                (eachitem)).reduce((pv, cv) => pv + cv, 0)
        }
        return (
            <div>
                <div>
                    {
                        Object.entries(props.langslist).map(([key, eachitem]) =>
                            <div>
                                <div key={key}>
                                    {key} - {Math.round(eachitem / totalcount)}%
                                    {totalcount}
              </div>
                                <div>{console.log(x = x + key.count + ',')}</div></div>)}
                </div>
                {console.log(x)}
                <div className='App-header'>
                <hr></hr>
                    <h2>Languages</h2>
                </div>
                <div>
                    <BarChart data={x.split(',')} size={[500, 500]} />
                    {x = ''}

                </div>
            </div>
        )
    } else { return null; }

};

export default LanguageList;
